contract/CryptoExchange.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract CryptoExchange is ReentrancyGuard, Ownable {
    IERC20 public clxToken;
    mapping(address => mapping(address => uint256)) public balances;
    mapping(address => string) public referralCodes;
    mapping(string => address) public codeToAddress;
    mapping(address => address) public referrers;
    mapping(address => uint256) public referralRewards;
    uint256 public bonusRate = 5; // 5% bonus rate
    uint256 public referralRate = 2; // 2% referral rate

    event Deposit(address token, address user, uint256 amount, uint256 balance);
    event Withdraw(address token, address user, uint256 amount, uint256 balance);
    event Trade(address user, address tokenIn, address tokenOut, uint256 amountIn, uint256 amountOut);
    event ReferralCodeGenerated(address user, string code);
    event ReferralRewardClaimed(address user, uint256 amount);
    event BonusRateUpdated(uint256 newRate);
    event ReferralRateUpdated(uint256 newRate);

    constructor(address _clxToken) Ownable() {
        require(_clxToken != address(0), "Invalid CLX token address");
        clxToken = IERC20(_clxToken);
    }

    function deposit(address token, uint256 amount) external nonReentrant {
        require(amount > 0, "Amount must be greater than 0");
        require(IERC20(token).transferFrom(msg.sender, address(this), amount), "Transfer failed");
        balances[token][msg.sender] += amount;
        emit Deposit(token, msg.sender, amount, balances[token][msg.sender]);
    }

    function withdraw(address token, uint256 amount) external nonReentrant {
        require(amount > 0, "Amount must be greater than 0");
        require(balances[token][msg.sender] >= amount, "Insufficient balance");
        balances[token][msg.sender] -= amount;
        require(IERC20(token).transfer(msg.sender, amount), "Transfer failed");
        emit Withdraw(token, msg.sender, amount, balances[token][msg.sender]);
    }

    function trade(
        address tokenIn,
        address tokenOut,
        uint256 amountIn,
        uint256 amountOut
    ) external nonReentrant {
        require(amountIn > 0 && amountOut > 0, "Amounts must be greater than 0");
        require(balances[tokenIn][msg.sender] >= amountIn, "Insufficient balance of input token");
        require(balances[tokenOut][address(this)] >= amountOut, "Insufficient balance of output token");

        // Calculate bonus
        uint256 bonus = (amountOut * bonusRate) / 100;
        uint256 totalAmountOut = amountOut + bonus;

        // Calculate referral reward
        address referrer = referrers[msg.sender];
        if (referrer != address(0)) {
            uint256 referralReward = (amountOut * referralRate) / 100;
            referralRewards[referrer] += referralReward;
        }

        balances[tokenIn][msg.sender] -= amountIn;
        balances[tokenIn][address(this)] += amountIn;
        balances[tokenOut][address(this)] -= totalAmountOut;
        balances[tokenOut][msg.sender] += totalAmountOut;

        emit Trade(msg.sender, tokenIn, tokenOut, amountIn, totalAmountOut);
    }

    function getBalance(address token, address user) external view returns (uint256) {
        return balances[token][user];
    }

    function generateReferralCode(string memory code) external {
        require(bytes(code).length > 0, "Code cannot be empty");
        require(codeToAddress[code] == address(0), "Code already exists");
        require(bytes(referralCodes[msg.sender]).length == 0, "User already has a code");

        referralCodes[msg.sender] = code;
        codeToAddress[code] = msg.sender;
        emit ReferralCodeGenerated(msg.sender, code);
    }

    function useReferralCode(string memory code) external {
        require(bytes(code).length > 0, "Code cannot be empty");
        require(codeToAddress[code] != address(0), "Invalid code");
        require(referrers[msg.sender] == address(0), "Already using a referral code");
