        uint256 rewards = referralRewards[msg.sender];
        require(rewards > 0, "No rewards to claim");
        referralRewards[msg.sender] = 0;
        emit ReferralRewardClaimed(msg.sender, rewards);
    }

    function setBonusRate(uint256 newRate) external onlyOwner {
        require(newRate <= 10, "Rate cannot exceed 10%");
        bonusRate = newRate;
        emit BonusRateUpdated(newRate);
    }

    function setReferralRate(uint256 newRate) external onlyOwner {
        require(newRate <= 5, "Rate cannot exceed 5%");
        referralRate = newRate;
        emit ReferralRateUpdated(newRate);
    }

    function getBonusRate() external view returns (uint256) {
        return bonusRate;
    }

    function getReferralRate() external view returns (uint256) {
        return referralRate;
    }
}

